@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:ATM a owl:Class .
atm:CashCard a owl:Class .
atm:Password a owl:Class .
atm:Account a owl:Class .
atm:Bank a owl:Class .
atm:Message a owl:Class .

atm:hasCashCard a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:CashCard .

atm:hasPassword a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Password .

atm:hasAccount a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Account .

atm:operatedBy a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Bank .

atm:communicates a owl:ObjectProperty ;
  rdfs:domain atm:Bank ;
  rdfs:range atm:Message .

atm:valid a owl:DatatypeProperty ;
  rdfs:domain [ owl:unionOf (atm:CashCard atm:Password atm:Account) ] ;
  rdfs:range xsd:boolean .

atm:hasProblem a owl:DatatypeProperty ;
  rdfs:domain atm:Account ;
  rdfs:range xsd:boolean .

atm:ProblemMessage a owl:NamedIndividual ;
  a atm:Message .
